import './App.css';
import Todo from './components/Todo';

function App() {

  let todos = [
    {
      id: 1, 
      name: "todo1",
      completed: false
    },
    {
      id: 2, 
      name: "todo2",
      completed: false
    }
  ];

  const handleCheckboxToggle = (id) => {
    console.log('checkbox changed', id);
  }

  return (
    <div className="App">
      {todos.map(todo => (
        <Todo todo={todo} checkboxHandler={handleCheckboxToggle} />
      ))}

      {/* {todos.map(function(todo) {
        return <Todo />
      })} */}
    </div>
  );
}

export default App;
